import React, {Component} from "react";
import cheese from "./cheese.jpg";
import pepperoni from "./pepperoni.jpg";
import "./Menu.css";

class Menu extends Component{
    render(){
        return(
            <div>
                <div class="grid-container">
                    <div class="grid-item">
                        <img alt="cheese" src={cheese}/>
                        <p>Cheese Pizza</p>
                    </div>
                    <div class="grid-item">
                        <img alt="pepperoni" src={pepperoni}/>
                        <p>Pepperoni Pizza</p>
                    </div>
                </div>
            </div>
        );
    }
}

export default Menu;
